import { useNavigate, useEffect } from 'react';


function Tasks() {
  const navigate = useNavigate();

  function isLoged() {
    const user = localStorage.getItem('taskuser');
    if (!user) {
      navigate('/login');
    }
  }

  useEffect(() => {
    isLoged();
  }, []);
  return (
    <main>
      tasks page.
    </main>
  )
}

export default Tasks;
